  return (
    <>
    <h1 className="title"> My Timer Totodoro</h1>
    <Tags />
    <Timer />
    <iframe
      src="https://open.spotify.com/embed/playlist/2rcMRS9fDOnuu5YUTXAcQZ?utm_source=generator" width="50%"
      height="152" frameBorder="0"
      allowfullscreen=""
      allow="autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture"
      loading="lazy">
    </iframe>

    </>

  );
}

export default App;
